"use strict";(self.webpackChunkwomeng_docs=self.webpackChunkwomeng_docs||[]).push([[352],{7864(e,a,n){n.r(a),n.d(a,{comp:()=>s,data:()=>h});var t=n(641);const i={},s=(0,n(6262).A)(i,[["render",function(e,a){return(0,t.uX)(),(0,t.CE)("div",null,[...a[0]||(a[0]=[(0,t.Fv)('<h1 id="自我介绍" tabindex="-1"><a class="header-anchor" href="#自我介绍"><span>自我介绍</span></a></h1><p>你好，我叫XXX，今年26岁，毕业于一所普通本科院校，专业是计算机科学技术专业，现在出来工作有两年多接近3年了，这几年就职于一家中小型公司，通过在工作中所做的项目，积累了一点点工作经验，同时也体会到了在工作中战胜困难解决问题的成就与乐趣。</p><p>那除了认真工作以外呢，我还会在工作之余，了解最新行业动态，比如最近特别流行的go语言有哪些特点，为什么docker要使用它来实现而不是用C啊、Java啊这些来实现，这些行业信息就会拓宽我的视野，增加我的技术广度。同时，我也经常在GitHub和gitee上面浏览那些比较受欢迎的项目，看看能不能为我所用，提高我们的生产效率。</p><p>那我最近跟的一个项目，是一个类似于商城这样的APP，在线买药的，它的后台是基于springcloud分布式架构的，它APP里面就包含有快速问诊、在线购药、饮食健康管理、金币福利中心等等这些功能，它的主营业务基本就是用户通过在线的医生了解一下自己的身体状况，如果医生有用药建议的话，用户就可以直接在APP上面买药了，这也比较方便。我的话跟这个项目的时间也不长，也只是参与过它的几个版本迭代，主要是拉新分佣返点、金币兑换优惠券、饮食健康管理、退款和评价这几个版本。</p><p>除了项目的这么东西以外，我还对MySQL这些有一定的了解，因为我也很清楚要想提升自己的技术深度，单单靠项目经验所带来的技术积累远远不够，一定还要靠持续不断的学习。</p><h1 id="项目表述" tabindex="-1"><a class="header-anchor" href="#项目表述"><span>项目表述</span></a></h1><h3 id="仓储管理系统" tabindex="-1"><a class="header-anchor" href="#仓储管理系统"><span>仓储管理系统</span></a></h3><p>那我最近的一个项目，是一个企业仓储管理系统，里面包含标签、库存、采购、生产、销售管理等一系列功能，app则包含扫码入库、质检、上架、出库、过账等，工作人员通过扫描标签二维码的方式对药品进行信息化管理，极大地提高了仓储管理效率。那我在项目里面主要是负责跟前端app和web对接，跟企业的SAP系统对接，标签打印、日志、部署上线等等工作。标签打印是用了一个报表软件画的模板，然后在后台填充数据生成PDF文件传递给前端进行打印，日志是使用Spring AOP实现的。</p>',8)])])}]]),h=JSON.parse('{"path":"/guide/%E8%87%AA%E6%88%91%E4%BB%8B%E7%BB%8D.html","title":"自我介绍","lang":"zh-CN","frontmatter":{},"headers":[{"level":3,"title":"仓储管理系统","slug":"仓储管理系统","link":"#仓储管理系统","children":[]}],"git":{"updatedTime":1767700977000,"contributors":[{"name":"womeng","username":"womeng","email":"donglongqin@qq.com","commits":1,"url":"https://github.com/womeng"}],"changelog":[{"hash":"b8e7af09363e2aa76ceb6847db16cbf052e12d54","time":1767700977000,"email":"donglongqin@qq.com","author":"womeng","message":"提交文档"}]},"filePathRelative":"guide/自我介绍.md"}')}}]);